import { Fc } from "react-icons/fa";

const CartItem = () => {
  return (
    <div>
      <div>
        <img/>
      </div>
      <h3></h3>
      <span></span>
      <div>
        <span></span>
          <FaRemoveFormat/>
      </div>
    </div>
  );
};

export default CartItem;
